import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { tradeAPI } from '../services/api';
import { toast } from 'react-toastify';

const Trades = () => {
  const [trades, setTrades] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    loadTrades();
  }, []);

  const loadTrades = async () => {
    try {
      const response = await tradeAPI.getAll();
      setTrades(response.data.trades);
    } catch (error) {
      toast.error('Failed to load trades');
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm('Delete this trade?')) return;
    try {
      await tradeAPI.delete(id);
      toast.success('Trade deleted');
      loadTrades();
    } catch (error) {
      toast.error('Failed to delete');
    }
  };

  if (loading) return <div className="loading-container"><div className="spinner"></div></div>;

  return (
    <div>
      <div style={{ display: 'flex', justifyContent: 'space-between', marginBottom: '2rem' }}>
        <h1>My Trades</h1>
        <Link to="/trades/new" className="btn-primary">+ Add Trade</Link>
      </div>

      {trades.length === 0 ? (
        <div style={{ textAlign: 'center', padding: '3rem' }}>
          <p>No trades yet. Start logging your trades!</p>
        </div>
      ) : (
        <table>
          <thead>
            <tr>
              <th>Date</th>
              <th>Pair</th>
              <th>Direction</th>
              <th>Outcome</th>
              <th>Pips</th>
              <th>AI Score</th>
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {trades.map(trade => (
              <tr key={trade._id}>
                <td>{new Date(trade.date).toLocaleDateString()}</td>
                <td>{trade.currencyPair}</td>
                <td>{trade.direction}</td>
                <td>
                  <span className={`badge badge-${trade.outcome === 'Win' ? 'success' : trade.outcome === 'Loss' ? 'danger' : 'warning'}`}>
                    {trade.outcome}
                  </span>
                </td>
                <td style={{ color: trade.pips >= 0 ? 'var(--success)' : 'var(--danger)' }}>
                  {trade.pips >= 0 ? '+' : ''}{trade.pips}
                </td>
                <td>{trade.aiFeedback?.executionScore || 'N/A'}/10</td>
                <td>
                  <Link to={`/trades/edit/${trade._id}`} style={{ marginRight: '1rem' }}>Edit</Link>
                  <button onClick={() => handleDelete(trade._id)} style={{ 
                    background: 'none', 
                    border: 'none', 
                    color: 'var(--danger)', 
                    cursor: 'pointer' 
                  }}>
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default Trades;
